  \"2015-09-26T23:08:03.834441\",\n\t\"name\": \"saipan-commonwealth-of-the-nothern-mariana-islands-2006-environmental-sensitivity-index-map\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Environmental Sensitivity Index (ESI) maps
  are an integral component in oil-spill contingency planning and assessment. They
  serve as a source of information in the event of an oil spill incident. ESI maps
  contain three types of information: shoreline habitats (classified according to
  their sensitivity to oiling), sensitive biological resources, and human-use resources.
  Most often, this information is plotted on 7.5 minute United States Geological Survey
  (USGS) quadrangles, although in the Alaska ESI maps, USGS topographic maps at scales
  of 1:63,360 and 1:250,000 are used, and in other ESI maps, NOAA charts have been
  used as the base map. Collections of these maps, grouped by state or a logical geographic
  area, are published as ESI atlases. Digital data have been published for most of
  the U.S. shoreline, including Alaska, Hawaii, and Puerto Rico.\",\n\t\"license_title\":
